import React, { useEffect } from 'react';
import { useRouter } from 'next/router';
import { v4 as uuidv4 } from 'uuid';

export default function Index() {
  const router = useRouter();

  useEffect(() => {
    const _id = uuidv4();
    router.replace(`/${_id}`);
  }, []);

  return <span style={{ backgroundColor: 'rgb(95, 188, 190)' }}></span>;
}
